import React, { useState } from 'react';
import { Pie } from 'react-chartjs-2';
import { Chart as ChartJS, ArcElement, Tooltip, Legend } from 'chart.js';
import './App.css';

ChartJS.register(ArcElement, Tooltip, Legend);

const votingData = {
  labels: ['Option 1', 'Option 2', 'Option 3'],
  datasets: [
    {
      label: '# of Votes',
      data: [12, 19, 3], // Example data, you can change it dynamically.
      backgroundColor: ['#FF6384', '#36A2EB', '#FFCE56'],
      hoverBackgroundColor: ['#FF6384', '#36A2EB', '#FFCE56'],
    },
  ],
};

function App() {
  const [walletConnected, setWalletConnected] = useState(false);
  const [voted, setVoted] = useState(false);
  const [selectedOption, setSelectedOption] = useState(null);
  const [darkMode, setDarkMode] = useState(false);
  const [helpModal, setHelpModal] = useState(false);

  const handleConnectWallet = () => {
    setWalletConnected(true);
  };

  const handleVote = (option) => {
    setSelectedOption(option);
    setVoted(true);
    // Perform the voting logic here (such as calling a smart contract).
  };

  const toggleDarkMode = () => {
    setDarkMode(!darkMode);
  };

  const toggleHelpModal = () => {
    setHelpModal(!helpModal);
  };

  return (
    <div className={`App ${darkMode ? 'dark-mode' : 'light-mode'}`}>
      <header className="App-header">
        <h1>Decentralized Voting Platform</h1>
        {!walletConnected ? (
          <button onClick={handleConnectWallet} className="connect-button">
            Connect Wallet
          </button>
        ) : (
          <>
            <p>Wallet Connected!</p>
            <button onClick={toggleHelpModal} className="help-button">
              Help
            </button>
            <button onClick={toggleDarkMode} className="theme-toggle">
              {darkMode ? 'Switch to Light Mode' : 'Switch to Dark Mode'}
            </button>
          </>
        )}
      </header>

      {walletConnected && (
        <div className="voting-section">
          <h2>Vote for Your Favorite Option</h2>
          {['Voting for Best Hackathon Project', 'Voting for Best Design', 'Voting for Best Innovation'].map((category, index) => (
            <button
              key={index}
              onClick={() => handleVote(category)}
              className="vote-button"
            >
              {category}
            </button>
          ))}

          {voted && (
            <div className="vote-confirmation">
              <p>You voted for: {selectedOption}</p>
              <div className="vote-animation">ðŸŽ‰ Thank you for voting! ðŸŽ‰</div>
            </div>
          )}

        <div className="chart-section">
          <h3>Voting Results</h3>
          <div className="chart-container">
            <Pie data={votingData} width={200} height={200} options={{ maintainAspectRatio: false }} />
          </div>
        </div>

        </div>
      )}

      {helpModal && (
        <div className="modal">
          <div className="modal-content">
            <span className="close" onClick={toggleHelpModal}>
              &times;
            </span>
            <h2>How to Use the Platform</h2>
            <p>1. Connect your wallet to participate in voting.</p>
            <p>2. Select the category you'd like to vote in.</p>
            <p>3. View the live voting results after casting your vote.</p>
          </div>
        </div>
      )}

      <footer>
        <div className="about-section">
          <h2>About the Voting Platform</h2>
          <p>
            This platform allows hackathon participants to vote on different
            categories such as Best Hackathon Project, Best Design, and Best
            Innovation. Make sure to connect your wallet to participate!
          </p>
        </div>
      </footer>
    </div>
  );
}

export default App;
